sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new AppointmentUtils();
    var appointments = utils.getAppointmentByPatient(inputs.patientid);
    outputs.appointmentList = JSON.stringify(appointments);
})(inputs, outputs);

